import Navbar from "../components/Navbar"; // Adjust relative path for components
import Footer from "../components/Footer";
import CursorEffect from "../components/CursorEffect";

import Home from "./Home"; // Adjust relative path for pages
import About from "./About";
import Work from "./Work";
import Contact from "./Contact";

import "../styles/style.css"; // Adjust relative path for styles

const App = () => {
  return (
    <>
      <CursorEffect /> {/* Add the CursorEffect */}
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/work" element={<Work />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
      <Footer />
    </>
  );
};

export default App;
